held out for roses
Turkish Delight
.
.
Malarkey ever pragmatic
prefers flat bread
untoasted
. 
.
There is no burden
just the usual kicks and pricks
and rotating shades
.
.
Tickets are cheap enough
we asked random questions
dropped in
.
.
After the sawdust
and fine sands of Thebes
we are left unburied
.
.
.
.
.
